import React from 'react';
import Header from './components/header.jsx';
import Footer from './components/footer.jsx';

const contentful = require('contentful');
const client = contentful.createClient({
  space: '9ulwy6m5jpxs',
  accessToken: '2fsQuk07Wtt-7WkWKul0SjHwPBTQp4frPW70aqKFoGo',
});

function Blog() {
  console.log("blog"+Date.now());
  const fetch = async () => {
    const entries = await client.getEntries();
    const posts =  await Promise.all(entries.items.map(entry => {
      <h3>{entry.fields.title}</h3>;
      <p>{entry.fields.message.content[0].content[0].value}</p>
    }))
  }


  console.log(entries);
  return (
    <main className="container">
      <h1>Blog</h1>
    </main>
  );
}

export default Blog;
